import React from 'react';

import Auxiliary from './../../hoc/Auxiliary';
import classes from './Layout.module.css';

function Layout(props) {
    return (
        <Auxiliary>
            <div>Toolbar</div>
            <main>
                {props.children}
            </main>
            <footer>
                Redes sociales
            </footer>
        </Auxiliary>
    )
}

export default Layout;
